import './App.css';
import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import {Redirect} from 'react-router';

import Register from './pages/register';
import Login from './pages/login'
import { Button } from 'antd';
import 'antd/dist/antd.css';
import './assets/less/message.less'
function App() {
  return (
    <div className="App">
      <header className="App-header">
       yaoyao
      <Button type="primary">Button</Button>
       <Router>
{/* 静态li路由导航 */}
       <ul>
        <li><NavLink to='/register' activeClassName="selected" activeStyle={{color: 'red'}} > Home页面</NavLink></li>
        <li><Link to='/login'>Mine页面</Link></li>
        </ul>

        <Route path='/register' component={Register}>注册导航</Route>
        <Route path='/login' component={Login} >登陆导航</Route>

       重定向： <Redirect from="messages/:id" to="/messages/:id" />
      </Router>

      </header>
    </div>
  );
}
export default App;
